                    <option value="2">2</option>
                    <option value="3">3</option>
                    <option value="4">4</option>
                </select>
            </div>
            <div className="ui_grid">
                {numbers.map(number => <div class="cell" key={number}>{number}</div>)}
            </div>
            <div className="main_bttom">
            Bottom
            </div>
        </div>
    );
}


export default Game;
